import axios from "../utils/axios.js";

class UserCourseService {
  async add(name) {
    await axios.post("/user/courses", null, {
      data: { name: name },
    });
  }
  async delete(name) {
    await axios.delete("/user/courses", {
      params: { text: name },
    });
  }
}

export default new UserCourseService();
